import React, { useState } from "react";

export const Api = () => {
    
    const [Apidata,updateApi] = useState()

    useEffect(()=>{
        axios.get('https://dummyjson.com/carts').then(
            (result)=>{
            
            updateApi(result.data.carts)
                    
            })
    },[])

    return {Apidata}

}

export default Api
